    const onChange = (e) =>{
        setForm({...form, [e.target.id] : e.target.value });
    }
    const [form, setForm] = useState({ nombre:'', fnac:'', carrera:'' });
    return(
        <BrowserRouter>
            <Switch>
                <Route exact path="/">
                    <IndexContainer />
                </Route>
                <Route path="/welcome">
                    <div>
                        <WelcomeContainer />
                    </div>
                </Route>
            </Switch>
        </BrowserRouter>
    )
}

export default App;
